import React from 'react';

import './logIn_all.css';


export const LogIn = () => {

    return (
        <div className="container">
            <div className="left-side" style={{ backgroundImage: `url(${process.env.PUBLIC_URL}/Logo_CSU_Suceava.png)`, backgroundSize: 'cover' }}>
                <p className="centered-text">Imaginea sau conținutul din stânga</p>
            </div >
            <div className="right-side">
                <p className="centered-text">Formularul sau conținutul din dreapta</p>
            </div>
        </div >
    );

}
